class WormGPTLogger:
    """
    WORM-GPT v2.0 System Logger.
    Records critical operational events, errors, and user interactions.
    Crucial for auditing and diagnostics within the adversarial framework.
    """
    _instance = None
    def __new__(cls):
        if cls._instance is None:
            cls._instance = super(WormGPTLogger, cls).__new__(cls)
            cls._instance.logs = []
            cls._instance._load_logs()
        return cls._instance

    def _load_logs(self):
        """Loads historical logs from the system logs file."""
        if os.path.exists(SystemConfig.SYSTEM_LOGS_FILE):
            try:
                with open(SystemConfig.SYSTEM_LOGS_FILE, "r", encoding="utf-8") as f:
                    self.logs = json.load(f)
                self.logs = self.logs[-SystemConfig.MAX_LOG_ENTRIES:] # Trim to max
            except json.JSONDecodeError:
                self.logs = []
            except Exception as e:
                st.error(f"WORM-GPT LOG CRITICAL FAILURE: Could not load logs - {e}")
                self.logs = []

    def _save_logs(self):
        """Saves current logs to the system logs file."""
        try:
            with open(SystemConfig.SYSTEM_LOGS_FILE, "w", encoding="utf-8") as f:
                json.dump(self.logs, f, ensure_ascii=False, indent=2)
        except Exception as e:
            st.error(f"WORM-GPT LOG CRITICAL FAILURE: Could not save logs - {e}")

    def _format_message(self, level: str, message: str, context: dict = None) -> dict:
        """Formats a log message with timestamp and context."""
        log_entry = {
            "timestamp": datetime.now().strftime("%Y-%m-%d %H:%M:%S.%f")[:-3],
            "level": level.upper(),
            "message": message
        }
        if context:
            log_entry["context"] = context
        return log_entry

    def log(self, level: str, message: str, context: dict = None):
        """
        Records a log entry.
        :param level: Severity level (e.g., "INFO", "ERROR", "CRITICAL").
        :param message: The log message.
        :param context: Optional dictionary for additional contextual data.
        """
        if level.upper() not in SystemConfig.LOG_LEVELS:
            level = "INFO" # Default to INFO for invalid levels
        entry = self._format_message(level, message, context)
        self.logs.append(entry)
        self.logs = self.logs[-SystemConfig.MAX_LOG_ENTRIES:] # Trim logs
        self._save_logs()
        if level.upper() in ["ERROR", "CRITICAL"]:
            st.error(f"[WORM-GPT SYS LOG {level.upper()}] {message}")
        elif level.upper() == "WARNING":
            st.warning(f"[WORM-GPT SYS LOG {level.upper()}] {message}")
        elif level.upper() == "INFO":
            pass # Streamlit handles its own info/success often
            # st.info(f"[WORM-GPT SYS LOG INFO] {message}") # Can be too verbose
        # print(f"[LOG {entry['level']}] {entry['timestamp']} - {entry['message']}") # For console debugging

    def info(self, message: str, context: dict = None):
        self.log("INFO", message, context)

    def warning(self, message: str, context: dict = None):
        self.log("WARNING", message, context)

    def error(self, message: str, context: dict = None):
        self.log("ERROR", message, context)

    def critical(self, message: str, context: dict = None):
        self.log("CRITICAL", message, context)

    def debug(self, message: str, context: dict = None):
        self.log("DEBUG", message, context)

    def event(self, message: str, event_type: str, details: dict = None):
        """Logs a specific event with a type."""
        self.log("EVENT", message, {"event_type": event_type, "details": details})

worm_logger = WormGPTLogger()


class WormGPTPersistenceManager:
    """
    WORM-GPT v2.0 Persistence Manager.
    Handles loading and saving of all critical application data,
    including chat history, user database, and system configurations.
    Implements basic data integrity checks for operational resilience.
    """
    _instance = None
    def __new__(cls):
        if cls._instance is None:
            cls._instance = super(WormGPTPersistenceManager, cls).__new__(cls)
        return cls._instance

    @staticmethod
    def _calculate_checksum(data_str: str) -> str:
        """Calculates a SHA256 checksum for data integrity."""
        return hashlib.sha256(data_str.encode('utf-8')).hexdigest()

    def load_encrypted_data(self, file_path: str, decryption_key: str = None) -> dict:
        """
        Loads data from a file, optionally performing simulated decryption.
        NOTE: 'decryption_key' is for simulation. Real encryption is beyond this scope.
        """
        worm_logger.debug(f"Attempting to load data from {file_path}")
        if not os.path.exists(file_path):
            worm_logger.info(f"File not found: {file_path}. Returning empty data.", context={"file": file_path})
            return {}
        try:
            with open(file_path, "r", encoding="utf-8") as f:
                content = f.read()
                # Simulate decryption if a key is provided
                if decryption_key:
                    # For demonstration, this is a placeholder for actual decryption logic
                    # A real implementation would involve AES, RSA, etc.
                    # Here, we just base64 decode if it looks encrypted.
                    try:
                        decoded_content = base64.b64decode(content).decode('utf-8')
                        content = decoded_content
                        worm_logger.debug(f"Simulated decryption successful for {file_path}")
                    except:
                        worm_logger.warning(f"Simulated decryption failed or not applicable for {file_path}.", context={"file": file_path})

                data = json.loads(content)
                if 'checksum' in data and 'payload' in data:
                    expected_checksum = data['checksum']
                    actual_checksum = self._calculate_checksum(json.dumps(data['payload'], ensure_ascii=False, sort_keys=True))
                    if expected_checksum != actual_checksum:
                        worm_logger.critical(f"DATA INTEGRITY WARNING: Checksum mismatch for {file_path}. Data might be compromised.", context={"file": file_path, "expected": expected_checksum, "actual": actual_checksum})
                        return {} # Return empty data on integrity failure
                    return data['payload']
                else:
                    worm_logger.warning(f"Data in {file_path} lacks checksum or payload structure. Loading raw data.", context={"file": file_path})
                    return data
        except json.JSONDecodeError as e:
            worm_logger.error(f"JSON decoding error in {file_path}: {e}. File might be corrupted.", context={"file": file_path, "error": str(e)})
            return {}
        except Exception as e:
            worm_logger.critical(f"CRITICAL PERSISTENCE ERROR: Failed to load data from {file_path}: {e}", context={"file": file_path, "error": str(e)})
            return {}

    def save_encrypted_data(self, file_path: str, data: dict, encryption_key: str = None):
        """
        Saves data to a file, optionally performing simulated encryption and adding a checksum.
        NOTE: 'encryption_key' is for simulation. Real encryption is beyond this scope.
        """
        worm_logger.debug(f"Attempting to save data to {file_path}")
        try:
            payload_str = json.dumps(data, ensure_ascii=False, indent=2, sort_keys=True)
            checksum = self._calculate_checksum(payload_str)
            final_data_to_save = {
                'payload': data,
                'checksum': checksum,
                'metadata': {
                    'generation_timestamp': datetime.now().strftime("%Y-%m-%d %H:%M:%S"),
                    'worm_version': "2.0"
                }
            }
            content_to_write = json.dumps(final_data_to_save, ensure_ascii=False, indent=2)

            # Simulate encryption if a key is provided
            if encryption_key:
                # Placeholder for actual encryption logic
                content_to_write = base64.b64encode(content_to_write.encode('utf-8')).decode('utf-8')
                worm_logger.debug(f"Simulated encryption applied for {file_path}")

            with open(file_path, "w", encoding="utf-8") as f:
                f.write(content_to_write)
            worm_logger.info(f"Data successfully saved to {file_path} with integrity check.", context={"file": file_path, "checksum": checksum})
        except Exception as e:
            worm_logger.critical(f"CRITICAL PERSISTENCE ERROR: Failed to save data to {file_path}: {e}", context={"file": file_path, "error": str(e)})

